// ==UserScript==
// @name         multiple search
// @namespace    https://github.com/KID-joker/userscript
// @version      1.0.4
// @updateURL    https://github.com/KID-joker/userscript/blob/main/multiple-search.js
// @downloadURL  https://github.com/KID-joker/userscript/blob/main/multiple-search.js
// @supportURL   https://github.com/KID-joker/userscript/issues
// @description  Multiple searches appear after wording
// @author       KID-joker
// @match        *://*/*
// @icon         https://raw.githubusercontent.com/KID-joker/userscript/main/assets/search.ico
// @grant        GM_log
// @grant        GM_addStyle
// @grant        unsafeWindow
// @run-at       document-start
// @license      MIT
// ==/UserScript==

(function () {
  const searchList = getSearchList();
  /**
   * html
   */
  function createFragment(list, { listen, parent }) {
    const fragment = document.createDocumentFragment();
    list.forEach(ele => {
      const button = document.createElement('div');
      button.id = `tool-${ele.name}`;
      button.className = 'tool-btn';
      button.title = ele.name;
      button.dataset.id = ele.name;
      if (parent) {
        button.dataset.parent = parent;
      }
      if (listen) {
        button.addEventListener('mouseenter', focusFunc);
        button.addEventListener('mouseleave', blurFunc);
      }
      const icon = document.createElement('img');
      icon.className = 'tool-icon';
      icon.src = ele.icon;
      icon.dataset.id = ele.name;
      if (parent) {
        icon.dataset.parent = parent;
      }
      button.appendChild(icon);
      fragment.appendChild(button);
    })
    return fragment;
  }
  function createComponent() {
    let box = document.querySelector('#userscript-search-toolbox');
    if (box) {
      box.style.display = 'block';
      return box;
    }
    box = document.createElement('div');
    box.id = 'userscript-search-toolbox';
    box.addEventListener('click', clickFunc);
    // box.addEventListener('mouseup', function(event) {
    //   event.stopPropagation();
    // })
    const fragment = createFragment(searchList, { listen: true });
    box.appendChild(fragment);
    return box;
  }
  function createChildComponent(id, list) {
    const box = document.createElement('div');
    box.id = `userscript-search-${id}`;
    box.className = 'userscript-search-childBox';
    box.style[position] = '100%';
    box.addEventListener('click', clickFunc);
    const fragment = createFragment(list, { parent: id });
    box.appendChild(fragment);
    return box;
  }

  /**
   * css
   */
  const cssStyle = `
    #userscript-search-toolbox {
      position: absolute;
      z-index: 999999;
      background-color: #fbfbfb;
      width: 44px;
      border-radius: 4px;
      -webkit-user-select: none;
      user-select: none;
    }

    #userscript-search-toolbox .tool-btn {
      position: relative;
      width: 44px;
      height: 44px;
      border-radius: 4px;
      display: flex;
      align-items: center;
      justify-content: center;
      cursor: pointer;
    }
    #userscript-search-toolbox .tool-btn:hover {
      box-shadow:0 3px 5px 0 rgba(0,0,0,.1)
    }

    #userscript-search-toolbox .tool-icon {
      margin: unset;
      height: 24px;
      width: 24px;
      padding: unset;
      border: unset;
      background: unset;
    }

    #userscript-search-toolbox .userscript-search-childBox {
      position: absolute;
      background-color: #fbfbfb;
      height: 44px;
      border-radius: 4px;
      display: flex;
      -webkit-user-select: none;
      user-select: none;
    }
  `
  GM_addStyle(cssStyle);

  /**
   * javascript
   */
  let selectText;
  let startX;
  document.addEventListener('keydown', hideElement);
  document.addEventListener('mousedown', function (event) {
    startX = event.clientX;
    hideElement(event);
  });
  document.addEventListener('mouseup', function (event) {
    if (event.button === 0) {
      setTimeout(() => {
        const selection = unsafeWindow.getSelection();
        selectText = selection.toString().trim();
        if (selection && selection.focusNode && selection.focusNode.nodeType == 3 && !!selectText) {
          position = event.clientX < startX ? 'left' : 'right';
          insertComponent(selection.focusNode.parentElement);
        }
      }, 300);
    }
  })
  function hideElement(event) {
    const ele = document.querySelector('#userscript-search-toolbox');
    if (ele && (!event || !event.path.includes(ele))) {
      ele.style.display = 'none';
    }
  }
  let position;
  function insertComponent(selectionElement) {
    const selectionDOMRect = selectionElement.getBoundingClientRect();
    const component = createComponent();
    if (selectionDOMRect.top + unsafeWindow.scrollY + 572 > document.body.clientHeight) {
      component.style.top = `${document.body.clientHeight - 572}px`;
    } else {
      component.style.top = `${selectionDOMRect.top + unsafeWindow.scrollY}px`;
    }
    if (position == 'left') {
      component.style.left = `${selectionDOMRect.left - 88}px`;
    } else {
      component.style.left = `${selectionDOMRect.right + 44}px`;
    }
    document.body.appendChild(component);
  }
  function insertChildComponent(parentId, list) {
    const childComponent = createChildComponent(parentId, list);
    const element = document.querySelector(`#tool-${parentId}`);
    element.appendChild(childComponent);
  }
  function clickFunc(event) {
    const parent = event.target.dataset.parent;
    const id = event.target.dataset.id;
    let list = searchList;
    if (parent) {
      let parentEle = searchList.find(ele => ele.name == parent);
      list = parentEle.children;
    }
    const ele = list.find(ele => ele.name == id);
    if (ele.func) {
      ele.func(selectText);
      return;
    }
    if (ele.link) {
      unsafeWindow.open(ele.link.replace('{{%s}}', selectText), '_blank');
      return;
    }
  }
  function focusFunc(event) {
    const id = event.target.dataset.id;
    const ele = searchList.find(ele => ele.name == id);
    if (ele && ele.children) {
      insertChildComponent(id, ele.children);
    }
  }
  function blurFunc(event) {
    const id = event.target.dataset.id;
    const ele = document.querySelector(`#userscript-search-${id}`);
    ele && ele.remove();
  }
})();

